import './App.css';
import Header from './component/header';
import {BrowserRouter, Route, Routes} from 'react-router-dom'
import Login from './component/login';
import practiceHeader from './component/practiceheader';
import login from './pages/login';


function App() {
  return (
    <>

    <BrowserRouter>
      <Route path='/main' component={practiceHeader} />
      <Routes>
        <Route path='/main/my' component={my} />
        <Route path='/main' component={practiceHeader} />
        <Route path='sign' component={login} />
        <Route render={()=> <div className='error'>에러페이지</div>} />
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
